g2:c.PROCEDURE.g2:a.TEXT:
_opfom-startup (Object: class gfr-startup-object, InitialStartup: truth-value, Modules: class symbol-list, Client: class object)
 
  devstuffName: symbol = the symbol gdev-internals-workspaces; 
  intstuffName: symbol = the symbol int-internals-workspaces;
  Err: class error;

begin

  {--- No startup required for module restart }
  if not(InitialStartup) then return;

  {--- For devstuff development environment } 
  if the item named by devstuffName exists then
    insert opfom-private at the end of the item-list named by devstuffName;
  if the item named by intstuffName exists then
    insert opfom-private at the end of the item-list named by intstuffName;

end on error (Err)
  call gerr-dispatch (Err, this procedure, gfr-default-window);
end

g2:c.METHOD.g2:a.TEXT:
opfom-calculate-priority (DISP: class _opfo-domain-object) = (integer)
MSG2: class message;
PRIORITY, P, PD: integer;
OBJ: class _opfo-domain-object;
Event: class gevm-event;

begin 
PRIORITY = opfom-default-initial-priority;
PD = the _opfo-highest-message-priority of DISP;

{inform the operator that "disp = [the opfo-external-name of disp]";}

  if _use-gevm then begin
    for Event = each gevm-event that is a-opfom-priority-influence-of DISP do
      P = the gevm-priority of Event;
      if P = PD then begin
        PRIORITY = PD;
        exit if true;
      end;
      if P < PRIORITY then
        PRIORITY = P;
    end;
  end else begin
    for MSG2 = each smh-transient-message that is a-opfom-priority-influence-of DISP do
      P = the smh-priority of MSG2;
      if P = PD then begin
        PRIORITY = PD;
        exit if true;
      end;
      if P < PRIORITY then
        PRIORITY = P;
    end;
  end;

if there exists an _opfo-domain-object that is a-opfom-priority-influence-of DISP then begin 
    P = the minimum over each _opfo-domain-object OBJ that is a-opfom-priority-influence-of DISP of (the _opfo-highest-message-priority of OBJ);
{inform the operator that "p = [p], disp = [the opfo-external-name of disp]";}
    if P < PRIORITY then PRIORITY =P; 
end;

return PRIORITY;
end

opfom-priority-change(DISP: class _opfo-domain-object, SUBORD: class _opfo-domain-object) 
{

} 
{
M, MSG2: class smh-transient-message; 
}
PRIORITY, P, OLD-PRIORITY, NEW-PRIORITY: integer;
VECT: class opfom-color-array;
SYM: symbol;
OBJ: class object;

WS: class kb-workspace;
NEED-TO-PROPAGATE: truth-value;

begin
{inform the operator that "disp = [the opfo-external-name of disp], sub = [the opfo-external-name of subord]";}
NEED-TO-PROPAGATE = false;
OLD-PRIORITY = call opfom-get-priority (DISP);
NEW-PRIORITY = call opfom-get-priority (SUBORD);

if NEW-PRIORITY < OLD-PRIORITY then begin
   call opfom-set-alarm-status (DISP, NEW-PRIORITY ); 
   NEED-TO-PROPAGATE = true;
   end
else begin  
   {Case where SUBORD may have been the highest-priority message-need to check other messages.  Can't tell now because SUBORD already has new priority:}
   PRIORITY = call opfom-calculate-priority(DISP);
   if PRIORITY > OLD-PRIORITY then begin 
         {need to change to color of next highest priority}
         NEED-TO-PROPAGATE = true;
         call opfom-set-alarm-status (DISP, PRIORITY);
   end;
end;
if NEED-TO-PROPAGATE and 
   there exists an object OBJ that is the-opfom-priority-influenced-by DISP 
      then call opfom-priority-change (OBJ, DISP);      
end

opfom-delete-message (DISP: class _opfo-domain-object , INFLUENCE: class item) 
SUP:class object;
PRIORITY,P, PI:integer;
ITM:class item;
begin

call opfom-acknowledge-message (DISP, INFLUENCE);

conclude that INFLUENCE is not a-opfom-priority-influence-of DISP;

if there exists an item that is a-opfom-priority-influence-of DISP then
begin
    P = the _opfo-highest-message-priority of DISP;
    PI = call opfom-get-priority (INFLUENCE);
    if PI = P then
    begin
        PRIORITY = call opfom-calculate-priority(DISP);
        if PRIORITY > P then
        begin
            {need to change to color of next highest priority}
            call opfom-set-alarm-status (DISP, PRIORITY);
             if there exists an object SUP that is the-opfom-priority-influenced-by DISP then
                call opfom-priority-change(SUP, DISP);
        end;
    end
    else if opfom-revert-priority-to-initial and PI = opfom-default-initial-priority then begin
        if PI > P then begin
            PRIORITY = call opfom-calculate-priority(DISP);
            if PRIORITY > P then
            begin
                {need to change to color of next highest priority}
                call opfom-set-alarm-status (DISP, PRIORITY);
                 if there exists an object SUP that is the-opfom-priority-influenced-by DISP then
                    call opfom-priority-change(SUP, DISP);
            end;
        end;
    end
    else if not (opfom-revert-priority-to-initial) and (PI = opfom-default-priority-on-del-of-last-msg) then begin
        if PI > P then begin
            PRIORITY = call opfom-calculate-priority(DISP);
            if PRIORITY > P then
            begin
                {need to change to color of next highest priority}
                call opfom-set-alarm-status (DISP, PRIORITY);
                 if there exists an object SUP that is the-opfom-priority-influenced-by DISP then
                    call opfom-priority-change(SUP, DISP);
            end;
        end;
    end;
end      
else begin {Case where INFLUENCE is the last associated with DISP}
   if opfom-revert-priority-to-initial then 
        call opfom-set-alarm-status (DISP, opfom-default-initial-priority ) 
   else call opfom-set-alarm-status (DISP, opfom-default-priority-on-del-of-last-msg); 
 
   if there exists an item ITM that is the-opfom-priority-influenced-by DISP then 
        call opfom-delete-message (ITM, DISP);  
end;
end

opfom-acknowledge-message (DISP: class _opfo-domain-object , INFLUENCE: class item) 
SUP:class object;
begin

conclude that INFLUENCE is not a-opfom-unacknowledged-influence-of DISP; 

if not (there exists an item that is a-opfom-unacknowledged-influence-of DISP ) then begin
    call opfom-set-acknowledgement-status (DISP, the symbol acknowledged); 
    SUP = call opfom-get-superior(DISP); 
    if SUP is not the same object as devu-safe-object then 
        call opfom-acknowledge-message (SUP, DISP); 
end; 
end

opfom-accept-message(DISP: class _opfo-domain-object, INFLUENCE: class item) 
{
propagation against DISP by INFLUENCE, INFLUENCE may be a message or another object
}
OLD-PRIORITY, NEW-INFLUENCE-PRIORITY: integer;
SUP: class object;  {for the superior item in hierarchy for alarm propagation}
DACK, ACK:symbol;

begin

OLD-PRIORITY = call opfom-get-priority (DISP);
NEW-INFLUENCE-PRIORITY = call opfom-get-priority (INFLUENCE);

if NEW-INFLUENCE-PRIORITY < OLD-PRIORITY then
    call opfom-set-alarm-status (DISP, NEW-INFLUENCE-PRIORITY );

conclude that INFLUENCE is a-opfom-priority-influence-of DISP;

ACK = call opfom-get-acknowledgement-status (INFLUENCE);
if ACK is not acknowledged then begin
   conclude that INFLUENCE is a-opfom-unacknowledged-influence-of DISP;
   call opfom-set-acknowledgement-status (DISP, the symbol unacknowledged );
   end;

SUP = call opfom-get-superior (DISP);
if SUP is not the same object as devu-safe-object then begin
   conclude that DISP is a-opfom-priority-influence-of SUP;
    DACK = call opfom-get-acknowledgement-status (DISP);
    if DACK is not acknowledged then begin 
        conclude that DISP is a-opfom-unacknowledged-influence-of SUP;
        call opfom-set-acknowledgement-status (SUP, the symbol unacknowledged ); 
    end;
   call opfom-accept-message (SUP, DISP);
   end;
end

opfom-get-superior (DISP:class _opfo-domain-object) = (class _opfo-domain-object) 
WS:class kb-workspace;
SUP:class item;
begin
if there exists a workspace WS of DISP then begin
    if there exists an item SUP superior to WS and SUP is an _opfo-domain-object then
        return SUP;
end;
return devu-safe-object ;
end

opfom-set-acknowledgement-status (DISP:class _opfo-domain-object, STATUS:symbol)
begin
{No need to change the status if it is already set to the same as STATUS}
if the _opfo-acknowledgement-status of DISP /= STATUS then
begin
    if STATUS is not acknowledged then
        change the acknowledgement-region icon-color of DISP to the value of opfom-unacknowledged-color 
    else
        change the acknowledgement-region icon-color of DISP to the value of opfom-acknowledged-color; 
    conclude that the _opfo-acknowledgement-status of DISP = STATUS;
end;
end

opfom-set-alarm-status (DISP:class _opfo-domain-object,PRI:integer)
begin
{No need to change the priority of DISP if it is already set to PRI}
if the _opfo-highest-message-priority of DISP /= PRI then
begin
    if PRI > the array-length of opfom-priority-alarm-colors then
        change the alarm-region icon-color of DISP to the value of opfom-default-priority-color
    else
        change the alarm-region icon-color of DISP to the value of opfom-priority-alarm-colors[PRI - 1];
    conclude that the _opfo-highest-message-priority of DISP = PRI;
end;
end

g2:c.PROCEDURE.g2:a.TEXT:
_opfom-mend-relations-for-obj (Obj: class _opfo-domain-object, Win: class ui-client-item)
Msg: class smh-transient-message;
TimeOut: integer = 86400; {1 day in seconds}
CurrentTime: float;
begin
    for Msg = each smh-transient-message that is a-opfom-priority-influence-of _opfom-deleted-domain-object-proxy do
        if the opfo-external-name of Obj = the smh-target of Msg then begin
            conclude that Msg is now a-opfom-priority-influence-of Obj;
        end;
    end;
    for Msg = each smh-transient-message that is a-opfom-unacknowledged-influence-of _opfom-deleted-domain-object-proxy do
        if the opfo-external-name of Obj = the smh-target of Msg then begin
            conclude that Msg is now a-opfom-unacknowledged-influence-of Obj;
        end;
    end;
end

_opfom-subscribe-for-creates ()
MI: class module-information;
ModuleName: symbol;
Win: class ui-client-item;
begin
    Win = call devu-safe-window ();
    ModuleName = gfr-get-module-of-item (this procedure);
    if there exists a module-information MI such that (the top-level-module of MI = ModuleName) then begin
        call dsm-subscribe-component (MI, the symbol CREATION, the symbol _opfom-mend-relations-for-obj, Win);
    end
    else post "OPFOM: Could not find module object for [ModuleName] that is required for DSM subscription.";
end

_opfom-cleanup-msgs-for-obj (Obj: class _opfo-domain-object, Win: class ui-client-item) = (integer)
Msg: class smh-transient-message;
begin
    for Msg = each smh-transient-message that is a-opfom-priority-influence-of Obj do
        conclude that Msg is now a-opfom-priority-influence-of _opfom-deleted-domain-object-proxy;
    end;
    for Msg = each smh-transient-message that is a-opfom-unacknowledged-influence-of Obj do
        conclude that Msg is now a-opfom-unacknowledged-influence-of _opfom-deleted-domain-object-proxy;
    end;

    return 0;
end

_opfom-subscribe-for-deletes ()
MI: class module-information;
ModuleName: symbol;
Win: class ui-client-item;
begin
    Win = call devu-safe-window ();
    ModuleName = gfr-get-module-of-item (this procedure);
    if there exists a module-information MI such that (the top-level-module of MI = ModuleName) then begin
        call dsm-subscribe-component (MI, the symbol DELETION, the symbol _opfom-cleanup-msgs-for-obj, Win);
    end
    else post "OPFOM: Could not find module object for [ModuleName] that is required for DSM subscription.";
end
